column8:
нарадзіўся 10 сакавіка 1956 года ў г.Жодзіна Мінскай вобласці,  адукацыя вышэйшая, скончыў Мінскі радыётэхнічны інстытут па  спецыяльнасці “Радыётэхніка”, кандыдат фізіка-матэматычных навук, дацэнт, першы прарэктар установы адукацыі “Беларускі дзяржаўны ўніверсітэт інфарматыкі і радыёэлектронікі”, беспартыйны. Жыве ў г.Мінску; 
жанаты выхаваў дваіх сыноў. Агульны памер даходу ў 2018 годзе – 38 505, 20 беларускіх рублёў, 
у асабістай уласнасці знаходзіцца легкавы аўтамабіль Ford Sierra 1989 года выпуску і легкавы аўтамабіль Renault  Duster 2016 года выпуску.
